    public static int lengthOfLongestSubstring(String s) {

        Set<Map<String, Integer>> mapList = new HashSet<>();

        char[] keyArrays1 = s.toCharArray();

        for(int z = 0; z < keyArrays1.length; z++) {
            String subString = s.substring(z);
            char[] keyArrays = subString.toCharArray();
            Map<String, Integer> keyMap = new HashMap<>();
            for(int i = 0; i < keyArrays.length; i++) {
                String key = Character.toString(keyArrays[i]);
                if( i == 0) {
                    keyMap.put(key, key.toCharArray().length);
                } else {
                    if(keyMap.containsKey(key)) {
                        i++;
                        continue;
                    } else {
                        keyMap.put(key, 1);
                        StringBuilder sb = new StringBuilder();
                        for(int x = 0; x <= i; x++) {
                            sb.append(keyArrays[x]);
                        }
                        //if string has repeating characters discard this key
                        String result = sb.toString();
                        if (!findRepeatingCharacters(result)) {
                            keyMap.put(result, result.toCharArray().length);
                        }
                    }
                }
               mapList.add(keyMap);
            }
        }

        int count = 0;
        for(Map<String, Integer> map : mapList) {
            for (Map.Entry<String,Integer> entry : map.entrySet()) {
                if (entry.getKey().toCharArray().length > count) {
                    count = entry.getKey().toCharArray().length;
                }
            }
        }
        return count;
    }

    private static boolean findRepeatingCharacters(String repeatString) {
        char[] repeatChar = repeatString.toCharArray();
        for(int i = 0; i < repeatChar.length; i++) {

                for(int j = i + 1; j < repeatChar.length - 1; j ++) {
                    if(repeatChar[i] == repeatChar[j]) {
                        return  true;
                    }
                }
        }
        return false;
    }
